import './TodoItem.css';

function TodoItem(props) {
    return (
        <li>
            <input class="custom-radio-checkbox__input" type="radio" name="genero" value="mujer" checked />

            <span class="custom-radio-checkbox__show custom-radio-checkbox__show--radio"></span>

            <p>{props.text}</p>

        </li>
    );
}
export { TodoItem };
